DROP TABLE IF EXISTS "city";
CREATE TABLE [city] (
  [cityDataId] INT NOT NULL, 
  [cityId] INT NOT NULL, 
  [cityName] text NOT NULL, 
  [cityEName] text NOT NULL, 
  [firstLetter] text NOT NULL, 
  [jianPin] TEXT, 
  [isHot] INT DEFAULT (0), 
  [cityNamePY] TEXT, 
  [countryID] TEXT, 
  [countryName] TEXT, 
  [weightFlag] INT DEFAULT (0), 
  [latitude] TEXT, 
  [longitude] TEXT DEFAULT (NULL), 
  [districtId] INT DEFAULT (0), 
  [hotFlag] DOUBLE, 
  CONSTRAINT [sqlite_autoindex_city_1] PRIMARY KEY ([cityDataId]));
